import React, { useState } from 'react';
import './SearchBoxStyles.css';

const PopSearchBox = () => {
	const [PopKeyWords, setPopKeyWords] = useState("");

	return(
		<div id="cover">
		  <form method="get" action="http://localhost:8080/contemporary-search">
		    <div className="tb">
		      <div className="td">
		      	<input 
		      		type="text" 
		      		placeholder="Search for Music" 
		      		onChange={e => setPopKeyWords(e.target.value)}
		      		required />
		      </div>
		      <div className="td" id="s-cover">
		        <button 
		        	type="submit"
		        	onClick={async () => {
		        		const response = await fetch('/contemporary-search', {
		        			method: 'POST',
		        			headers: {
		        				'Content-Type': 'application/json'
		        			},
		        			body: JSON.stringify(PopKeyWords)
		        		})
		        		console.log(PopKeyWords)
		        		if (response.ok){
		        			console.log('response worked!')
		        		}
		        		else {console.log('doesnt work')}
		        	}}
		        	>
			          <div id="s-circle"></div>
			          <span></span>
		        </button>
		      </div>
		    </div>
		  </form>
		</div>
	);
}


export default PopSearchBox;






